事故や災害による車内閉じ込め時に役立つ、非常用のセーフティーハンマーです。<br><br>
窓を割る為のハンマーに、シートベルトカッターが内蔵されています。<br>
付属の台座で車内に固定出来ます。
<br><br>

製品の詳細
<br><br>
■ 製造国・メーカー：ドイツ・HR リヒター社製<br>
■ ボディーカラー：オレンジ<br>
■ 製品サイズ：192 x 94 x 37 mm<br><br><h2>HR RICHTER AUTO-COMFORT MADE IN GERMANY</h2>
<font size="2" color="#464646">
iPhone・スマートフォン・カメラの車載に最適。リヒター・マウントシステムは、ご使用の機器に合わせ、取り付け場所に応じて、ホルダーとマウントを自由に組み合わせてご利用いただけます。</font>
<br><br>
<img width="825" src="http://image.rakuten.co.jp/richter/cabinet/richter/richter_top01.jpg"><br><br>
<h2>4 Point Fix System & 4 Quick Fix System</h2>
<font size="2" color="#464646">
ホルダーとマウントの接続方法には、4ポイント・フィックス（4PF）と4クイック・フィックス（4QF）、2種類のマウントシステムをご用意。用途に合わせてマウントをお選びいただけます。<br>※ シェルケースなど、一部の専用ホルダーは4QFのみに対応、カメラプレートやアダプターなどは4PFのみ対応となります。</font>
